import React from 'react';
import {CardDisplayV} from './src/CardWidget';

const cardData=[
  //{
//   header:"01.",
//   title:"Optimize Processing",
//   description:"Simplify and automate student registration and certification."
// },

];


const ContentHeaderStyles={
  display:'flex',
  justifyContent:'center',
  fontWeight:'900',
  color:'orange',
  fontSize:'80px',
  marginTop:'5px',
}

const ContentTitleStyles={
  display:'flex',
  fontWeight:'800',
  color:'black',
  textTransform: 'uppercase',
  fontSize:'20px',
  marginTop:'10px',
}

const ContentIconStyles={
  width:'100px',
  height:'100px'
}

const ContentDescriptionStyles={
  display:'flex',
  fontWeight:'300',
  fontSize:'20px',
  marginTop:'10px',
}


function App() {
  return (
    <div>
     <CardDisplayV
     cardData={cardData}
     ContentHeaderStyles={ContentHeaderStyles}
     ContentTitleStyles={ContentTitleStyles}
     ContentIconStyles={ContentIconStyles}
     ContentDescriptionStyles={ContentDescriptionStyles}
     />
    </div>
  );
}

export default App;
